import React from 'react';

const CityButton = (props) => {
    return (
        <div style={{backgroundImage: `url(${props.image})`}}>
            <a href={`/itineraries(${this.props.name.toLowwerCase()})`}>{this.props.name}</a>
        </div>
    )
}

export default CityButton;
